import React from 'react';
import rightBar from './rightBar.scss';

const RightBar = () => {
  return (
    <div className="rightBar">
      <div className="container">
        <div className="recomendastion">
          <span className="name">Recomendtion friends for you</span>
          <div className="item">
            <img src="" alt="user_ava" />
          </div>
        </div>
      </div>
    </div>
  );
};
export default RightBar;
